DROP TABLE IF EXISTS ORDERDETAILS;
DROP TABLE IF EXISTS ORDERS;
DROP TABLE IF EXISTS PRODUCTS;
DROP TABLE IF EXISTS CATEGORIES;
DROP TABLE IF EXISTS CUSTOMERS;
DROP TABLE IF EXISTS EMPLOYEES;  
DROP TABLE IF EXISTS SUPPLIERS;


CREATE TABLE CATEGORIES 
   (	CATEGORYID INTEGER, 
	CATEGORYNAME VARCHAR(15), 
	DESCRIPTION VARCHAR(300)
   );
   
    CREATE TABLE CUSTOMERS 
   (	CUSTOMERID CHAR(5), 
	COMPANYNAME VARCHAR(40), 
	CONTACTNAME VARCHAR(30), 
	CONTACTTITLE VARCHAR(30), 
	ADDRESS VARCHAR(60), 
	CITY VARCHAR(15), 
	POSTALCODE VARCHAR(10), 
	COUNTRY VARCHAR(15), 
	PHONE VARCHAR(24), 
	FAX VARCHAR(24)
   );
   
   CREATE TABLE EMPLOYEES 
   (	EMPLOYEEID INTEGER, 
	LASTNAME VARCHAR(20), 
	FIRSTNAME VARCHAR(10), 
	TITLE VARCHAR(30), 
	BIRTHDATE DATE, 
	HIREDATE DATE, 
	ADDRESS VARCHAR(60), 
	CITY VARCHAR(15), 
	POSTALCODE VARCHAR(10), 
	COUNTRY VARCHAR(15)
   );
   
   CREATE TABLE ORDERS 
   (	ORDERID INTEGER, 
	CUSTOMERID CHAR(5), 
	EMPLOYEEID INTEGER, 
	ORDERDATE DATE, 
	REQUIREDDATE DATE, 
	SHIPPEDDATE DATE, 
	FREIGHT INTEGER, 
	SHIPNAME VARCHAR(40), 
	SHIPADDRESS VARCHAR(60), 
	SHIPCITY VARCHAR(15), 
	SHIPPOSTALCODE VARCHAR(10), 
	SHIPCOUNTRY VARCHAR(15)
   );
   
   CREATE TABLE ORDERDETAILS 
   (	ORDERID INTEGER, 
	PRODUCTID INTEGER, 
	UNITPRICE INTEGER, 
	QUANTITY INTEGER, 
	DISCOUNT INTEGER
   );
   
   CREATE TABLE PRODUCTS 
   (	PRODUCTID INTEGER, 
	PRODUCTNAME VARCHAR(40), 
	SUPPLIERID INTEGER, 
	CATEGORYID INTEGER, 
	QUANTITYPERUNIT VARCHAR(20), 
	UNITPRICE INTEGER, 
	UNITSINSTOCK INTEGER
   );
   
   CREATE TABLE SUPPLIERS 
   (	SUPPLIERID INTEGER, 
	COMPANYNAME VARCHAR(40), 
	CONTACTNAME VARCHAR(30), 
	CONTACTTITLE VARCHAR(30), 
	ADDRESS VARCHAR(60), 
	CITY VARCHAR(15), 
	POSTALCODE VARCHAR(10), 
	COUNTRY VARCHAR(15), 
	PHONE VARCHAR(24), 
	FAX VARCHAR(24)
   );
   







CREATE UNIQUE INDEX PK_CATEGORIES_IDX ON CATEGORIES (CATEGORYID);
CREATE UNIQUE INDEX PK_CUSTOMERS_IDX ON CUSTOMERS (CUSTOMERID);
CREATE UNIQUE INDEX PK_EMPLOYEES_IDX ON EMPLOYEES (EMPLOYEEID);
CREATE UNIQUE INDEX PK_ORDERS_IDX ON ORDERS (ORDERID);
CREATE UNIQUE INDEX PK_ORDER_DETAILS_IDX ON ORDERDETAILS (ORDERID, PRODUCTID);
CREATE UNIQUE INDEX PK_PRODUCTS_IDX ON PRODUCTS (PRODUCTID);
CREATE UNIQUE INDEX PK_SUPPLIERS_IDX ON SUPPLIERS (SUPPLIERID);

ALTER TABLE CATEGORIES ADD CONSTRAINT PK_CATEGORY PRIMARY KEY (CATEGORYID);
ALTER TABLE CATEGORIES ALTER CATEGORYID SET NOT NULL;
ALTER TABLE CATEGORIES ALTER CATEGORYNAME SET NOT NULL;


ALTER TABLE CUSTOMERS ADD CONSTRAINT PK_CUSTOMER PRIMARY KEY (CUSTOMERID);
ALTER TABLE CUSTOMERS ALTER CUSTOMERID SET NOT NULL;
ALTER TABLE CUSTOMERS ALTER COMPANYNAME SET NOT NULL;


ALTER TABLE EMPLOYEES ADD CONSTRAINT PK_EMPLOYEES PRIMARY KEY (EMPLOYEEID);
ALTER TABLE EMPLOYEES ALTER EMPLOYEEID SET NOT NULL;
ALTER TABLE EMPLOYEES ALTER LASTNAME SET NOT NULL;
ALTER TABLE EMPLOYEES ALTER FIRSTNAME SET NOT NULL;


ALTER TABLE ORDERS ADD CONSTRAINT PK_ORDER PRIMARY KEY (ORDERID);
ALTER TABLE ORDERS ALTER ORDERID SET NOT NULL;

ALTER TABLE ORDERDETAILS ADD CONSTRAINT CK_DISCOUNT CHECK ((Discount >= 0 and Discount <= 1));
ALTER TABLE ORDERDETAILS ADD CONSTRAINT CK_QUANTITY CHECK ((Quantity > 0));
ALTER TABLE ORDERDETAILS ADD CONSTRAINT CK_UNITPRICE CHECK ((UnitPrice >= 0));
ALTER TABLE ORDERDETAILS ADD CONSTRAINT PK_ORDER_DETAIL PRIMARY KEY (ORDERID, PRODUCTID);
ALTER TABLE ORDERDETAILS ALTER ORDERID SET NOT NULL;
ALTER TABLE ORDERDETAILS ALTER PRODUCTID SET NOT NULL;
ALTER TABLE ORDERDETAILS ALTER UNITPRICE SET NOT NULL;
ALTER TABLE ORDERDETAILS ALTER QUANTITY SET NOT NULL;
ALTER TABLE ORDERDETAILS ALTER DISCOUNT SET NOT NULL;

ALTER TABLE PRODUCTS ADD CONSTRAINT CK_PRODUCT_UNITPRICE CHECK ((UnitPrice >= 0));
ALTER TABLE PRODUCTS ADD CONSTRAINT CK_UNITSINSTOCK CHECK ((UnitsInStock >= 0));
ALTER TABLE PRODUCTS ADD CONSTRAINT PK_PRODUCT PRIMARY KEY (PRODUCTID);
ALTER TABLE PRODUCTS ALTER PRODUCTID SET NOT NULL;
ALTER TABLE PRODUCTS ALTER PRODUCTNAME SET NOT NULL;

ALTER TABLE SUPPLIERS ADD CONSTRAINT PK_SUPPLIER PRIMARY KEY (SUPPLIERID);
ALTER TABLE SUPPLIERS ALTER SUPPLIERID SET NOT NULL;
ALTER TABLE SUPPLIERS ALTER COMPANYNAME SET NOT NULL;


ALTER TABLE ORDERS ADD CONSTRAINT FK_ORDER_CUSTOMER FOREIGN KEY (CUSTOMERID) REFERENCES CUSTOMERS (CUSTOMERID);
ALTER TABLE ORDERS ADD CONSTRAINT FK_ORDER_EMPLOYEE FOREIGN KEY (EMPLOYEEID) REFERENCES EMPLOYEES (EMPLOYEEID);

ALTER TABLE ORDERDETAILS ADD CONSTRAINT FK_ORDERDETAIL_ORDER FOREIGN KEY (ORDERID) REFERENCES ORDERS (ORDERID);
ALTER TABLE ORDERDETAILS ADD CONSTRAINT FK_ORDERDETAIL_PRODUCT FOREIGN KEY (PRODUCTID) REFERENCES PRODUCTS (PRODUCTID);

ALTER TABLE PRODUCTS ADD CONSTRAINT FK_PRODUCT_CATEGORY FOREIGN KEY (CATEGORYID) REFERENCES CATEGORIES (CATEGORYID);
ALTER TABLE PRODUCTS ADD CONSTRAINT FK_PRODUCT_SUPPLIER FOREIGN KEY (SUPPLIERID) REFERENCES SUPPLIERS (SUPPLIERID);


